import logo from './logo.svg';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { NavBar } from "./components/NavBar";
import { Banner } from "./components/Banner";
import { Skills } from "./components/Skills";
import { Projects } from "./components/Projects";
import { Contact } from "./components/Contact";
import { Footer } from "./components/Footer";
import { Cards } from "./components/Cards" ;
import axios from 'axios';
import { useEffect, useState } from 'react';

function App() {
  const [error, setError] = useState(null);
  const [homePage, setHomePage] = useState({ Description: "", Title: "", SubTitle:"" });

  useEffect(() => {
    axios
      .get('http://localhost:1337/api/home-page?populate=*')
      .then(({ data }) => setHomePage(data.data.attributes.BannerLayout))
      .catch((error) => setError(error))
  }, [])
  useEffect(() => {
    axios
      .get('http://localhost:1337/api/home-page?populate=*')
      .then(({ data }) => setHomePage(data.data.attributes.clients))
      .catch((error) => setError(error))
  }, [])


  if (error) {
    // Print errors if any
    return <div>An error occured: {error.message}</div>;
  }
  return (
    <div className="App">
       <ul>
        <li key={homePage.Title}>{homePage.Description} - {homePage.Title} - {homePage.SubTitle} </li>
      </ul>
      <ul>
        <li key={homePage.Title}>{homePage.Title} - {homePage.Description} - {homePage.carousel} </li>
      </ul>


      <NavBar />
      <Banner />
      <Skills />
      <Cards />
      <Projects />
      <Contact />
      <Footer />
    </div>
  );
}

export default App;
